"""Prior to Z-projection, zarr is loaded as a 5D tensor, with a shape of (40, 1, 16, 256, 256). The first dimension (40) is the time axis - the dataset contains 40 frames recorded over the course of the experiment. The second dimension (1) shows that the movie was captured using a single fluorescence channel. The third dimension (16) is the number of z-slices collected at each timepoint, meaning that every frame is actually a small stack of 16 images taken at different focal depths. Finally, the last two dimensions (256 √ó 256) are simply the height and width of each image, giving the spatial resolution of the field of view.

Because Dicty aggregation occurs in the two-dimensional XY plane, there is redundant depth information in the z-stack for the purpose of modeling (we have already confirmed it by investigating all the frames) . We then apply a max-projection over the z-dimension which collapses each stack of 16 slices into a single 2D image. Therefore the data becomes a 4D tensor, with a shape of (40, 1, 256, 256), and is now a clean 2D time-lapse movie, ready for further development and analysis.

###A4. Modelling

##Define the learning setup

This problem makes the most sense as a supervised, more specifically, self-supervised, learning task. Even though the dataset doesn‚Äôt come with labels, the movie itself gives us a natural way to create them: we can use a short sequence of earlier frames as the input and the following frame as the prediction target. For instance, frames t, t+1, t+2, and t+3 can be used to predict frame t+4. Framing the task this way turns it into a nonlinear regression problem where the model learns how the pattern of Dicty cells changes over time.

To approach this, we use a convolutional neural network that takes a window of past frames and tries to predict the next one. This works well because Dicty aggregation doesn‚Äôt happen all at once: cells gradually start responding to chemical signals, forming density patterns and early organized cell trajectories that point toward where the group of cells will eventually appear. These early spatial cues show up clearly in the images, so a CNN can learn them and use that information to forecast what the next frame should look like. Once trained, the model effectively learns the movement patterns and can be used to anticipate where the aggregation nucleus will form, even from early frames. I think next-frame prediction is the best because it is straightforward, interpretable, and well-matched to the biological process we‚Äôre trying to model.

##Specify the optimization target

The model‚Äôs optimization target is to predict the next frame in the movie based on a short sequence of earlier frames. Let each frame at time $t$ be a continuous-valued fluorescence image $\mathbf{x}_t \in \mathbb{R}^{H \times W}$.

If we use a window of size $w$, then the model receives $\mathbf{X}_t = \left( \mathbf{x}_{t - w + 1}, \ldots, \mathbf{x}_t \right) \in \mathbb{R}^{w \times H \times W}$ as input, and it outputs a prediction $\hat{\mathbf{x}}_{t+1} = f_\theta(\mathbf{X}_t)$ for the next frame. The training objective is to minimize the difference between $\hat{\mathbf{x}}_{t+1}$ and the true next frame $\mathbf{x}_{t+1}$. Since the frames are real-valued pixel matrices, this becomes a straightforward pixel-wise regression problem.

To train the model, we minimize the mean squared error (MSE) loss: $L(\theta) = \frac{1}{N} \sum_{t \in \mathcal{I}_{\text{train}}} \left\| f_\theta(\mathbf{X}_t) - \mathbf{x}_{t+1} \right\|_F^2$, where $\|\cdot\|_F$ denotes the Frobenius norm (ie the sum of squared pixel differences). MSE works well here because it directly measures how far each predicted intensity is from the actual intensity, and the squared penalty encourages the model to pay attention to large deviations. In practice, this helps the network learn both broad movement patterns (e.g the direction in which cells start to stream) and subtle local shifts in brightness that reflect changes in cell density. While other loss functions could be used, MSE provides a stable, simple, and very common baseline for next-frame prediction tasks like this.

To split the data, we divide the 40-frame sequence into training and testing sets using an 80/20 chronological split. If the valid prediction indices are $\{1, 2, \ldots, 39\}$, then an 80\% training portion corresponds to ùìò‚Çú·µ£‚Çê·µ¢‚Çô = {1, ..., 32},‚ÄÉùìò‚Çú‚Çë‚Çõ‚Çú = {33, ..., 39}.


A random shuffle would mix early and late frames and effectively leak information from the future into the past, which would undermine the temporal forecasting nature of the task. By training only on the earlier part of the movie and evaluating on the later part, the model is asked to extrapolate forward in time ‚Äî learning from the start of the aggregation process and then being tested on its ability to anticipate the more developed streaming patterns that come later.
"""

#TinyCNN applies a 3D convolution over the full window
class TinyCNN(nn.Module):
    def __init__(self,K):
        super().__init__()
        self.enc = nn.Sequential(
            nn.Conv3d(1,8,kernel_size=(K,3,3),padding=(0,1,1)),
            nn.ReLU()
        )
        self.head = nn.Sequential(
            nn.Conv2d(8,16,3,padding=1),
            nn.ReLU(),
            nn.Conv2d(16,1,1)
        )

    def forward(self,x):
        x = x.permute(0,2,1,3,4)
        z = self.enc(x).squeeze(2)
        return self.head(z)

