    for xb,yb in loader:
        xb=xb.to(DEVICE)
        yb=yb.to(DEVICE)
        opt_used.zero_grad()
        pred=model(xb)
        loss=loss_used(pred,yb)
        loss.backward()
        opt_used.step()
        total+=loss.item()*xb.size(0)
    return total/len(loader.dataset)

