#@title Error vs number of input frames ‚Äî reproducible version
Ks = [2, 3, 4, 5, 6, 7, 8, 9, 10]
errors_vs_K = []

def quick_train_center_model(K_test, epochs=30, seed=7):
     # reproducible model init + training
    ds = SlidingWindowDataset(movies_list, K=K_test)

    # reproducible dataloader shuffle
    loader = DataLoader(
        ds,
        batch_size=8,
        shuffle=True,
        generator=torch.Generator().manual_seed(seed)
    )

    m = ConvLSTMCenterModel(K_test).to(DEVICE)
    opt = torch.optim.Adam(m.parameters(), lr=1e-3)
    loss_fn = nn.MSELoss()

    for ep in range(epochs):
        m.train()
        for xb, yb in loader:
            xb = xb.to(DEVICE)
            yb = yb.to(DEVICE)
            opt.zero_grad()
            pred = m(xb)
            loss = loss_fn(pred, yb)
            loss.backward()
            opt.step()
    return m

for idx, K_test in enumerate(Ks):
    # use a different but fixed seed per K
    seed_K = 777 + idx
    set_seed(seed_K)

    m = quick_train_center_model(K_test, epochs=5, seed=seed_K)

    errs = []
    for mv in movies_list:
        true_c = compute_true_center(mv)
        x = torch.tensor(mv[:K_test]).float().to(DEVICE).unsqueeze(0)
        with torch.no_grad():
            pred = m(x).cpu().numpy()[0]
        err = np.sqrt(((pred - true_c)**2).sum())
        errs.append(err)

    errors_vs_K.append(np.mean(errs))

plt.figure(figsize=(6,4))
plt.plot(Ks, errors_vs_K, '-o')
plt.xlabel("Input frames K")
plt.ylabel("Center error (px)")
plt.title("Error vs Input Frames")
plt.grid(True)
plt.show()

"""The error-vs-K curve shows that the center error stays in a narrow range (roughly 175‚Äì177 px) for all K values tested, from K=2 up to K=10 with step 1. The curve fluctuates a bit but shows no consistent improvement as more frames are added. This suggests that, in this lightweight training setup, early-frame appearance does not sharply differentiate between final aggregation outcomes. The overall flatness of the curve matches the visual similarities across very early frames: the movies look nearly identical at early timepoints, so supplying more of these similar frames doesn‚Äôt noticeably help the model. The fact that the ConvLSTM model performs well in repeated-run evaluation but not in the quick K-curve training further supports this interpretation - this model needs deeper training and more passes through the dataset to extract subtle temporal cues."""

